import React from "react";
import "./Socials.css";

export default function Socials() {
  return (
    <section className="container">
      <a
        class="btn btn-icon btn-twitter"
        href="https://twitter.com/mirronake"
        rel="noopener"
      >
        <i class="bi bi-twitter"></i>
        <span>Twitter</span>
      </a>
    </section>
  );
}
